import "./Curriculums_visualization.css"

import {ourCurriculumEmpty} from "../common/common_values";
import Curriculums_review from "../Curriculums_review/Curriculums_review";
import GeneralInformationAboutCurriculum from "../common/GeneralInformationAboutCurriculum";

const Curriculums_visualization = (props) => {

    const {valuesGroupsSkills, id, curriculums} = props;


    const curriculumForVisualization = ourCurriculum(id, curriculums);

    let tableValuesGroupsSkills = valuesGroupsSkills.map(el => {
        const estimate = Math.ceil((el.estimate)*100)/100;

        return (
            <tr>
                <td>{el.name}</td>
                <td>{estimate}</td>
                <td>{el.fragment}</td>
                <td>Цвет</td>
            </tr>
        )
    })



    return (
        <div>
            <div>
<GeneralInformationAboutCurriculum ourCurriculum={curriculumForVisualization} />
                <button>estimates</button>
                <button>disciplines</button>
            </div>

            <div>
                Отредактировать "улыбку"
            </div>
            <div>
                Показать нулевые элементы
            </div>

            <div>
                <table>
                    <thead>
                        <tr>
                            <th>Group skills</th>
                            <th>Estimate</th>
                            <th>Fragment</th>
                            <th>Color</th>
                        </tr>
                    </thead>
                    <tbody>
                        {tableValuesGroupsSkills}
                    </tbody>
                </table>
            </div>

            <div>
                Таблица редактирования
            </div>

        </div>
    )
}

export default Curriculums_visualization;
